            <Router>
            <div>

            <h1>WELCOME VENDOR {this.props.match.params.id}</h1>
            <Link to={"vendor/"+this.props.match.params.id+"/add"}>Add Product List</Link>
            <Route path={"vendor/"+this.props.match.params.id+"/add"} component={Addproduct}/>
            </div>
            </Router>
        )
    }
}
